svg.script:
function $(sel) { return document.querySelector(sel); }

setTimeout(function(){
  $("#all").setAttribute("class", "animated");

  for(i=2; i<=62; i+=2) {
    $("#bd" + i).setAttribute("display", "none");
  }

  for(i=2; i<=9; i+=2) {
    $("#rd" + i).setAttribute("display", "none");
  }

  setTimeout(function(){
    $("#mask_rect").setAttribute("class", "animated");
    $("#symbol1").setAttribute("class", "animated");
  }, 700);

  setTimeout(function(){
    $("#all").setAttribute("class", "");
  }, 1400);

  setTimeout(function(){
    $("#symbol1").setAttribute("class", "moved");
    $("#symbol2").setAttribute("class", "animated");
  }, 4200);

  setTimeout(function(){
    $("#symbol2").setAttribute("class", "moved");
    $("#symbol3").setAttribute("class", "animated");
  }, 7700);

  setTimeout(function(){
    $("#symbol3").setAttribute("class", "moved");
    $("#symbol4").setAttribute("class", "animated");
  }, 11200);

  setTimeout(function(){
    $("#symbol4").setAttribute("class", "moved");

    for(i=2; i<=62; i+=2) {
      $("#bd" + i).setAttribute("display", "visible");
    }

    for(i=2; i<=9; i+=2) {
      $("#rd" + i).setAttribute("display", "visible");
    }

    $("#all").setAttribute("class", "rewind");

    $("#mask_rect").setAttribute("class", "");

  }, 14500);

}, 1000);
